INSERT INTO `COURSE` VALUES (96,95,'Main Course','modifiedrogaine',0,0,'<div class=\"listhdr\">\r\n	Race Overview</div>\r\n<ul class=\"simple\">\r\n	<li>\r\n		The race is divided into three sections: Bike Section. consisting of points B1-B8, East Trek consisting of ET1-ET3 and West Trek consisting of WT1-WT6.</li>\r\n	<li>\r\n		The race starts and finishes at labeled S/F.</li>\r\n	<li>\r\n		<span style=\"font-weight: bold;\">Race cutoff is 12 hours 9:30pm.</span> Teams must be back at the start/finish by 9:30pm arriving after this time will result in DQ</li>\r\n	<li>\r\n		All maps are pre plotted and optional east trek UTM coordinates will be provided.</li>\r\n	<li>\r\n		After finishing the course either full or part you must either check out with the volunteer in S/F area or sign out on the provided spreadsheet.</li>\r\n	<li>\r\n		For sections WT and ET all racers must sign in/out with times and report number of checkpoints retrieved</li>\r\n</ul>\r\n<div class=\"listhdr\">\r\n	Section Order</div>\r\n<ul class=\"simple\">\r\n	<li>\r\n		Teams can complete all sections in any order. However, once a team starts a section, they need to .finish. that section . meaning to get as many points as they want within that section -- before moving on to the next section. Once a team finishes a section, they can.t go back later and punch points on a section they.ve finished. Teams can.t punch CPs from a section other than the one they are working on at that time.</li>\r\n</ul>\r\n<div class=\"listhdr\">\r\n	Control Point Order</div>\r\n<ul class=\"simple\">\r\n	<li>\r\n		Rogaine format so any order you choose in the designated section.</li>\r\n</ul>\r\n<div class=\"listhdr\">\r\n	Additional Details</div>\r\n<ul class=\"simple\">\r\n	<li>\r\n		Bikes are mandatory on the bike section and no bikes are allowed on the trek sections, All points are either on right off the trail/FS road or easily accessible from it. You may drop your bike at any place to retrieve a bike CP.</li>\r\n	<li>\r\n		Absolutely no bikes on or around the Appalachian or Benton MacKaye trails.</li>\r\n	<li>\r\n		If going for the optional east trek bikes must be dropped at B4, after dropping bikes you may then start the east trek after either checking in w/ the volunteer or signing in on the provided spreadsheet. Each team must also check out in the same manner stating the number of CP.s retrieved either to the volunteer or in the provided space on the spreadsheet.</li>\r\n	<li>\r\n		The west trek must be started and finished at the start/finish location for the race. You must check in/out with the volunteer and you must state the number of CP.s retrieved or if the volunteer is not on site the provided spreadsheet must be filled in by each team.</li>\r\n	<li>\r\n		There are no off-limits areas on the course, and the bike trails can be ridden in either direction. Be watchful for other riders as the trails are extremely popular, for good reason! Always yield to horse riders. Feel free to bushwhack or bike whack wherever you see fit with the exception of the AT and BMT where no bikes are allowed but bushwhacking is.</li>\r\n	<li>\r\n		Teams can use the Start/Finish location as a transition area which they can visit at any time during the race. That includes while in the middle of working on a race section.</li>\r\n	<li>\r\n		Use your trail map along with the topographic map to determine how to best get around.</li>\r\n	<li>\r\n		There&#39;s plenty of water out there. Be sure to treat it before drinking, but you.ll have plenty of opportunities to fill up your water bottles.</li>\r\n</ul>\r\n','10895','default','default','default','default','default','default','no'),(175,174,'Race Course','stage',24,110,'<p>\r\n	Course Description</p>\r\n','16066','default','AtomicAdventureRaceFeedMix','AtomicAdventureRaceBlog','AtomicAdventureRacePhotos','AtomicAdventureRaceVideos','AtomicAdventureRaceAudio','no');
/*!40000 ALTER TABLE `COURSE` ENABLE KEYS */;
